INSERT INTO Animais VALUES ('1', 'Agnetha', '1546308000000', X'', 'Agnetha, a estrela pop brilhante, é uma gata graciosa que encanta a todos com seu charme. Sua voz suave é como música para os ouvidos e seu pelo é tão macio quanto o veludo. Ela é uma diva no mundo felino.', 'F', '1', 'A', '1700618883001');
INSERT INTO Animais VALUES ('2', 'Frida', '1514772000000', X'', 'Frida, a gata pop icônica, é uma artista talentosa que pinta com suas patinhas. Seu estilo ousado e sua personalidade única fazem dela uma sensação nas redes sociais. Ela adora dançar ao som de sua própria música.', 'F', '1', 'A', '1700618883106');
INSERT INTO Animais VALUES ('3', 'Elvis', '1614567600000', X'', 'Elvis é o rei dos animais, com seu charme e voz potente que faz todos balançarem o rabinho. Ele adora fazer shows de rock'n'roll para sua plateia felina.', 'M', '1', 'F', '1700618883408');
INSERT INTO Animais VALUES ('4', 'Madonna', '1495249200000', X'', 'Madonna, a gata fashionista, é conhecida por seu estilo extravagante e dança inigualável. Ela é a rainha da pista de dança felina.', 'F', '0', 'A', '1700618884116');
INSERT INTO Animais VALUES ('5', 'Bowie', '1572577200000', X'', 'Bowie, o gato camaleão, muda de personalidade e aparência constantemente. Ele é um artista versátil e sempre surpreende seus fãs.', 'M', '0', 'PA', '1700618884153');
INSERT INTO Animais VALUES ('6', 'MJ', '1533092400000', X'', 'MJ, o mestre do moonwalk felino, é famoso por seus passos de dança incríveis. Ele é o verdadeiro Rei do Pop entre os animais.', 'M', '1', 'D', '1700618884250');
INSERT INTO Animais VALUES ('7', 'Taylor', '1581649200000', X'', 'Taylor, a gata da música country, tem um coração do tamanho do Texas. Ela canta sobre histórias de amor e aventura.', 'F', '1', 'A', '1700618884378');
INSERT INTO Animais VALUES ('8', 'Whitney', '1504580400000', X'', 'Whitney, a diva da balada felina, tem uma voz poderosa que faz todos se emocionarem. Ela é a estrela das noites estreladas.', 'F', '0', 'A', '1700618884721');
INSERT INTO Animais VALUES ('9', 'Elton', '1480557600000', X'', 'Elton, o gato extravagante, adora se apresentar em shows glamourosos. Ele é o mestre das teclas e dos óculos de sol.', 'M', '1', 'A', '1700618884803');
INSERT INTO Animais VALUES ('10', 'Stevie', '1525143600000', X'', 'Stevie, o gato do blues, toca sua guitarra com alma e sentimento. Ele transforma suas experiências em músicas emotivas.', 'M', '0', 'PA', '1700618884849');
